import React, { Component } from 'react'
import { FaFreeCodeCamp } from "react-icons/fa";
export default class Form2 extends Component {
    
    state={
        items:["PHP/MYSQL","NODEJS/MONGODB","C#/SQLSERVER","JAVA/ORACLE"],
   
    }
    tarik=(e)=>{
     console.log(e.target.value);
    }
    render() {
        return (
            <div>
                 <form>
                     <select onChange={this.tarik}>
                         {this.state.items.map(i=>{return <option>{i}</option>;})}
                     </select>
                     <button>Remove</button>
                 </form>
            </div>
        )
    }
}
